    edges = list()
    for _ in range(m):
        u, v, w = map(int, input().split())
        edges.append((u, v, w))
    nodes = set([u for u, _, _ in edges]) | set([v for _, v, _ in edges])
    graph = {u: {v: 1 for v in nodes} for u in nodes}

    for u, v, w in edges:
        if graph[u][v]!= w:
            graph[u][v] += w
            graph[v][u] += w

    def min_number_of_operations(n: int) -> int:
        edges = set([u for u, _, _ in edges]) | set([v for _, v, _ in edges])
        mst = set()
        visited = set()

        def dfs(cur_node):
            if cur_node in mst:
                return 0
            visited.add(cur_node)
            res = min([graph[cur_node][n] for n in edges if n not in visited])
            for nxt_node in graph[cur_node]:
                if nxt_node not in visited:
                    res = min([res, 1 + dfs(nxt_node)])
            mst.add(cur_node)
            return res

        return sum([dfs(u) for u in nodes])

    return str(min_number_of_operations(1))

