    @cache
    def dp(i, j, t):
        if i == 0 and j == 0:
            return tiles[i, j]
        if i == 0:
            return dp(i, j - 1, t)
        if j == 0:
            return dp(i - 1, j, t)
        if tiles[i, j] == -1:
            return tiles[i, j]
        return min(dp(i, j - 1, t), dp(i - 1, j, t), dp(i - 1, j - 1, t))

    return str(dp(N - 1, M - 1, t))

