    def valid(l, d, x):
        for i in range(l, d+1):
            sum_n = sum([int(c) for c in str(i)])
            if sum_n == x:
                return True
        return False

    def lower_bound(l, d, x):
        lo, hi = l, d+1
        while lo <= hi:
            mid = (lo + hi)//2
            if valid(l, mid, x):
                hi = mid-1
            else:
                lo = mid+1
        return lo

    def upper_bound(l, d, x):
        lo, hi = l, d+1
        while lo <= hi:
            mid = (lo + hi)//2
            if valid(mid, d, x):
                lo = mid+1
            else:
                hi = mid-1
        return lo

    return str(lower_bound(l, d, x)) +'' + str(upper_bound(l, d, x))

