    f, s, g, u, d = [int(x) for x in stdin.split()]

    def push_up(s, g):
        return g - s if g > s else 0

    def push_down(s, g):
        return g - s if g > s else 0

    def distance_up(s, g, f):
        return push_up(s, g) + push_up(s + 1, g + f)

    def distance_down(s, g, f):
        return push_down(s, g) + push_down(s + 1, g + f)

    def min_steps_to_target(s, g, f):
        if g == s:
            return 0

        if g < s:
            return "use the stairs"

        for i in range(s, g):
            if i == s + 1:
                return distance_down(s, i, f)
            if i == g - 1:
                return distance_up(s, i, f)
            else:
                return min(distance_up(s, i, f), distance_down(s, i, f))

    return min_steps_to_target(s, g, f)

